import React, { useState, ChangeEvent } from 'react';

interface FormData {
  participantFullName: string;
  dateOfBirth: string;
  age: string;
  grade: string;
  gender: string;
  school: string;
  parentGuardianName: string;
  parentGuardianPhoneNumber: string;
  parentEmail: string;
  address: string;
  insuranceProvider: string;
  policyNumber: string;
  allergiesMedicalConcerns: string;
  participantPhoneNumber: string;
  participantEmail: string;
  primaryPhysician: string;
  primaryPhysicianPhoneNumber: string;
  physicianAddress: string;
  tShirtSize: string;
  mediaReleaseConsent: boolean;
  liabilityReleaseConsent: boolean;
}

const YouthProgramRegistrationForm: React.FC = () => {
  const [formData, setFormData] = useState<FormData>({
    participantFullName: '',
    dateOfBirth: '',
    age: '',
    grade: '',
    gender: '',
    school: '',
    parentGuardianName: '',
    parentGuardianPhoneNumber: '',
    parentEmail: '',
    address: '',
    insuranceProvider: '',
    policyNumber: '',
    allergiesMedicalConcerns: '',
    participantPhoneNumber: '',
    participantEmail: '',
    primaryPhysician: '',
    primaryPhysicianPhoneNumber: '',
    physicianAddress: '',
    tShirtSize: '',
    mediaReleaseConsent: false,
    liabilityReleaseConsent: false,
  });

  const handleChange = (e: ChangeEvent<HTMLInputElement | HTMLSelectElement | HTMLTextAreaElement>) => {
    const { name, value, type } = e.target as HTMLInputElement;
    const checked = (e.target as HTMLInputElement).checked;
    setFormData(prev => ({
      ...prev,
      [name]: type === 'checkbox' ? checked : value,
    }));
  };

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    console.log(formData);
  };

  return (
    <div className="max-w-4xl mx-auto p-6 bg-white shadow-lg rounded-lg">
      <h1 className="text-3xl font-bold text-center mb-6">
